import React from 'react'
import Album from '../components/Album'
import '../App.css';

export default function FavoritesContainer({ favorites }) {
    const showFavorites = () => {

        return favorites.map( album => {

            return (
                <Album
                    key={album.id}
                    {...album}
                />
            )
        })
    }

    return (
        <div className="album-container">
            {showFavorites()}
        </div>
    )
}
